                            <div class="w-[60%] z-10">
                                <p class="text-[#000] text-justify"><strong>ایکات اکسکلوسیو:</strong> محصولاتی در سطح
                                    جهانی
                                    <br>
                                    ایکات با معرفی خط تولید جدید "ایکات اکسکلوسیو"، به عرصه‌ای تازه از
                                    تــولید پوشاک بـــــا کیفیت بسیار بالا ورود کرده است. این خط تولید به
                                    دنبال ارائه محصولاتی است که از نظر متریال و دوخت با برندهای معتبر
                                    جهـــــانی رقابت کنـــد. پوشاک <b>ایکات اکسکلوسیو</b> با تمرکــز بر جزئیات و
                                    مراقبت ویژه در فرآیند تولید، نیازهای شیک‌پوشان و افرادی که به دنبال
                                    لباس‌های خاص و بی‌نقص هستند را تأمین می‌کند.</p>
                            </div>
                            <div style="left: 136px !important;" class="view-store-button flex justify-end w-[60%]">
