                        <p class="last-ecut-section-paragraph">
                            بــرند ایکات با ۳۵ سال سابقه درخشان در تولید پوشاک مردانه، به عنوان
                            یکی از رهبـــران صنعت پـــوشاک ایـــران شناخته مـــی‌شود. این
                            بـــرند با تکـــیه بر شعار "ما استاندارد بدن را می‌شناسیم" و ارائه
                            محصولاتی با کیفیت بـــالا، همواره سعی کرده است تا تجربه‌ای لذت‌بخش
                            از خـرید پوشاک را به مشتریان خود ارائه دهد. با راه‌انـــــــــــدازی
                            خطوط تولید جدید و استفاده از تبلیغات علمی و اسپانسرینگ تیم‌هـــای
                            ورزشی، ایکات در مسیر رشد و تعالی قدم برمی‌دارد. تعهد ایـن برند به
                            مشتریانش و تلاش برای ارتقای سطح کیفی پــوشاک در ایران، ایکات را به
                            عنوان یکی از پیشگامان صنعت پوشاک کشور متمایز کرده است.
                        </p>
