                        <div class="box-about rounded-[10px]   w-full h-auto flex pt-[1.5rem] flex-col items-start">
                            <div class="title-box-about  flex flex-col items-center px-[2rem] mb-[12px]">
                                <h3 class="font-bold">معرفی</h3>
                                <h3>Introduction</h3>
                            </div>
                            <div class="box-text flex flex-col"></div>
                        </div>
                        <div class="answer">
                            <p class="text-center leading-[24px] text-[13px]">
                                پوشاک مــردانه ایکات با سابقه‌ای درخشان و تجربه‌ای بیش از ۳۵ سـال در زمینه تولید و
                                عــرضه پوشاک مــردانه، یکی از بــرندهای شنـاخته‌شده و معتبر در صنعت پــــــوشاک ایـــران
