<script>
    function dynamicShowSections(index) {
        try {
            // hide all vectors
            $('.vector-image-class img').hide(0, function () {
                // show vector image
                $('.vector-image-class img[data-vector-index="' + index + '"]').show(0);
                $('.image-container a.dynamic-item.active').removeClass('active');
                $('.image-container a.dynamic-item[data-image-index="' + index + '"]').addClass('active');

            })


            // hide all paragraphs
            $('.dynamic-section-paragraph').hide(0, function () {
                // show paragraph
                $('.dynamic-section-paragraph[data-index="' + index + '"]').show(0)
            })
        } catch (error) {
            console.log('error')
        }

    }
    $(document).ready(function () {
        $('.accordion-list > li > .answer').hide();

        $('.accordion-list > li').click(function () {
            if ($(this).hasClass("active")) {
                $(this).removeClass("active").find(".answer").slideUp();
            } else {
                $(".accordion-list > li.active .answer").slideUp();
                $(".accordion-list > li.active").removeClass("active");
                $(this).addClass("active").find(".answer").slideDown();
            }
            return false;
        });

    });
</script>

